CREATE TABLE `morp_cms_news_group` (  `ngid` int(11) NOT NULL AUTO_INCREMENT,  `ngname` varchar(40) COLLATE utf8_unicode_ci NOT NULL,  `edit` int(1) NOT NULL DEFAULT '1',  `format` int(1) NOT NULL DEFAULT '1',  `nlang` int(1) NOT NULL DEFAULT '1',  `targetID` int(11) NOT NULL,  PRIMARY KEY (`ngid`)) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
DROP TABLE `newsletter`;
CREATE TABLE `newsletter` (  `nlid` int(11) NOT NULL AUTO_INCREMENT,  `nlname` varchar(100) NOT NULL DEFAULT '',  `nlsubj` varchar(250) NOT NULL DEFAULT '',  `nlmail` varchar(150) NOT NULL DEFAULT '',  `nldatum` date NOT NULL DEFAULT '0000-00-00',  `text` text NOT NULL,  `nlimg1` varchar(50) NOT NULL DEFAULT '',  `nlimg2` varchar(50) NOT NULL DEFAULT '',  `edit` int(1) NOT NULL DEFAULT '1',  `layout` int(1) NOT NULL DEFAULT '1',  UNIQUE KEY `nlid` (`nlid`)) ENGINE=MyISAM DEFAULT CHARSET=latin1;
DROP TABLE `morp_cms_pdf`;
CREATE TABLE `morp_cms_pdf` (  `pid` int(11) NOT NULL AUTO_INCREMENT,  `pdesc` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',  `plong` text COLLATE utf8_unicode_ci NOT NULL,  `pname` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',  `psize` int(11) NOT NULL DEFAULT '0',  `pdate` date NOT NULL DEFAULT '0000-00-00',  `pgid` int(11) NOT NULL DEFAULT '1',  `edit` int(1) NOT NULL DEFAULT '0',  `pimage` varchar(150) COLLATE utf8_unicode_ci NOT NULL,  `pstart` date NOT NULL,  `pend` date NOT NULL,  `locked` int(11) NOT NULL,  PRIMARY KEY (`pid`)) ENGINE=MyISAM AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
DROP TABLE `pdf_group`;
CREATE TABLE `pdf_group` (  `pgid` int(11) NOT NULL AUTO_INCREMENT,  `pgname` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',  `parent` int(11) NOT NULL,  `pgart` int(1) NOT NULL DEFAULT '1',  `pghl` varchar(255) COLLATE utf8_unicode_ci NOT NULL,  `img1` varchar(255) COLLATE utf8_unicode_ci NOT NULL,  PRIMARY KEY (`pgid`)) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
DROP TABLE `pfad`;
CREATE TABLE `pfad` (  `id` int(11) NOT NULL AUTO_INCREMENT,  `url` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',  `navid` int(11) NOT NULL DEFAULT '0',  `parent` int(11) NOT NULL DEFAULT '0',  `page` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',  `wg` int(1) NOT NULL DEFAULT '0',  PRIMARY KEY (`id`)) ENGINE=MyISAM AUTO_INCREMENT=31 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
DROP TABLE `tabelle`;
CREATE TABLE `tabelle` (  `tabid` int(11) NOT NULL AUTO_INCREMENT,  `tabtext` text COLLATE utf8_unicode_ci NOT NULL,  `spalte` int(11) NOT NULL DEFAULT '0',  `reihe` int(11) NOT NULL DEFAULT '0',  `edit` int(1) NOT NULL DEFAULT '1',  `cid` int(11) NOT NULL DEFAULT '0',  PRIMARY KEY (`tabid`)) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
DROP TABLE `template`;
CREATE TABLE `template` (  `tid` int(11) NOT NULL AUTO_INCREMENT,  `morp_cms_content` text COLLATE utf8_unicode_ci NOT NULL,  `edit` int(1) NOT NULL DEFAULT '1',  `tname` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',  `layout` int(1) NOT NULL DEFAULT '1',  PRIMARY KEY (`tid`),  UNIQUE KEY `tname` (`tname`)) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
DROP TABLE `user`;
CREATE TABLE `user` (  `uid` int(11) NOT NULL AUTO_INCREMENT,  `uname` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',  `pw` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',  `berechtigung` int(11) DEFAULT NULL,  `admin` int(1) NOT NULL DEFAULT '0',  `email` varchar(150) COLLATE utf8_unicode_ci NOT NULL,  `title` varchar(10) COLLATE utf8_unicode_ci NOT NULL,  `lastname` varchar(100) COLLATE utf8_unicode_ci NOT NULL,  `firstname` varchar(100) COLLATE utf8_unicode_ci NOT NULL,  `auths` varchar(50) COLLATE utf8_unicode_ci NOT NULL,  PRIMARY KEY (`uid`)) ENGINE=MyISAM AUTO_INCREMENT=38 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
DROP TABLE `morp_cms_protokoll`;
CREATE TABLE `morp_cms_protokoll` (  `prid` int(11) NOT NULL AUTO_INCREMENT,  `id` int(11) NOT NULL DEFAULT '0',  `db` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',  `uid` int(11) NOT NULL DEFAULT '0',  `datum` date NOT NULL DEFAULT '0000-00-00',  `art` varchar(6) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',  PRIMARY KEY (`prid`)) ENGINE=MyISAM AUTO_INCREMENT=470 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
